=head1 NAME

Chess::Opening::ECO - ECO data

=head1 SYNOPSIS

	use Chess::Opening::ECO;

	$positions = Chess::Opening::ECO->positions;

=head1 DESCRIPTION

This module is a mere container for the ECO (Encyclopedia of Chess Openings)
data.  You should rather use one the high-level interface
L<Chess::Opening::Book::ECO> for accessing or browsing the data contained here.

=head1 METHODS

=over 4

=item B<positions>

This is the only method in this module.  You can call it as a class method
or simply as C<Chess::Opening::ECO::Data>.  It returns a reference to a hash
of opening positions.  The keys of this hash are the positions in
Forsyth-Edwards Notation (FEN).  The values have four items:

=over 8

=item B<eco>

The ECO code of the position.  Note that these codes contain the so-called
"Scid Extensions to ECO", see L<http://scidvspc.sourceforge.net/doc/ECO.htm>.
If you are only interested in the pure ECO code, strip off everything after
the third character.

=item B<variation>

The name of the variation (like "Sicilian", "El Greco", and so on).  Note that
this is always the English name of the variation.  Use L<Chess::Opening::ECO>
if you want to have them translated into the user's language.

=item B<parent>

The parent position as FEN or C<undef> for the starting position.

=item B<moves>

A reference to a possibly empty array of moves that lead from this position
to other opening positions.

=back

=back

